return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'cs','pot-creation-date'=>'2026-01-07 15:23-0600','po-revision-date'=>'2026-01-07 15:23-0600','translation-revision-date'=>'2026-01-07 15:23-0600','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.8','messages'=>['%1$s is currently %2$spaused%3$s, and is not serving calendars on front end pages. You can resume serving calendars under the %4$sUtilities%5$s tab %6$shere%7$s.'=>'%1$s je momentálně %2$spozastaveno%3$s a nezobrazuje kalendáře na úvodních stránkách. Zobrazení kalendářů můžete obnovit na kartě %4$sNástroje%5$s %6$szde%7$s.','%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sPoužíváte ICS Calendar v implementaci WordPress Playground.%2$s Protože ICS Calendar je určen pro provoz na webovém serveru, některé funkce mohou být nedostupné nebo nemusí fungovat správně.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sVaše stránka momentálně používá nastavení časové zóny založené na posunu UTC.%2$s To může způsobit chyby v zobrazení času v %3$spluginu v lokalitách, kde se používá letní čas. Pro správné zobrazení času prosím %4$szměňte nastavení časové zóny%5$s na město nejblíže vaší lokalitě, které se nachází ve stejné časové zóně. Další informace k tomuto problému naleznete v naší %6$sdokumentaci%7$s.','Important! Your %1$s configuration appears to be exceeding source calendar provider rate limits.'=>'Důležité! Vaše konfigurace %1$s zřejmě překračuje limity poskytovatele zdrojového kalendáře.','If your calendars are not loading properly, please review your %1$s settings and usage:'=>'Pokud se vaše kalendáře nenačítají správně, zkontrolujte prosím nastavení a použití %1$s:','Do not use %1$s in your shortcodes. This feature is intended for troubleshooting only, and should not be left on permanently.'=>'Nepoužívejte %1$s ve svých zkrácených kódech. Tato funkce je určena pouze pro řešení problémů a neměla by být ponechána trvale zapnutá.','Increase the %1$s %2$sTransient (cache) expiration%3$s setting to %4$s43200%5$s (12 hours) or greater, to reduce the frequency of requests to the provider. (See note below.)'=>'Zvyšte nastavení %1$s %2$sTransient (cache) expiration%3$s na %4$s43200%5$s (12 hodin) nebo více, abyste snížili frekvenci požadavků na poskytovatele. (Viz poznámka níže.)','Avoid including a large number of feeds (10 or more) from the same provider in a single %1$s shortcode.'=>'Vyhněte se zahrnutí velkého počtu zdrojů (10 nebo více) od stejného poskytovatele do jednoho krátkého kódu %1$s.','Temporarily pause ICS Calendar on your front-end pages using the %1$sPause Calendars%2$s utility. (24-48 hours is recommended.)'=>'Dočasně pozastavte kalendář ICS na svých front-endových stránkách pomocí nástroje %1$sPozastavit kalendáře%2$s. (Doporučuje se 24–48 hodin.)','%1$s includes built-in caching, specifically to improve performance and avoid exceeding provider rate limits. Circumventing this caching with a very low %2$sreload%3$s setting may trigger a temporary block on your web server IP address, or possibly on your entire hosting network, by the calendar provider.'=>'%1$s obsahuje vestavěné ukládání do mezipaměti, které slouží zejména ke zlepšení výkonu a zabránění překročení limitů poskytovatele. Obcházení tohoto ukládání do mezipaměti pomocí velmi nízkého nastavení %2$sreload%3$s může vést k dočasnému zablokování IP adresy vašeho webového serveru nebo případně celé vaší hostingové sítě poskytovatelem kalendáře.','After making the recommended changes, please allow up to 24 hours for your calendar provider to remove any temporary blocks on your IP address. If you find that the problem persists, please use our %1$ssupport request form%2$s to contact us, and be sure to include your %3$ssystem report%4$s.'=>'Po provedení doporučených změn počkejte až 24 hodin, než poskytovatel kalendáře odstraní dočasné blokování vaší IP adresy. Pokud problém přetrvává, kontaktujte nás pomocí %1$sformuláře žádosti o podporu%2$s a nezapomeňte přiložit %3$ssystémovou zprávu%4$s.','Note: Set the %1$sTransient (cache) expiration%2$s as large as possible, considering how frequently event information in your calendar is typically updated. %3$s Remember that you can use the %4$sClear Cached Calendar Data%5$s utility to manually clear the cache at any time, if needed.'=>'Poznámka: Nastavte %1$sTransient (cache) expiration%2$s na co nejvyšší hodnotu s ohledem na to, jak často se informace o událostech ve vašem kalendáři obvykle aktualizují. %3$s Nezapomeňte, že v případě potřeby můžete kdykoli ručně vymazat mezipaměť pomocí nástroje %4$sClear Cached Calendar Data%5$s.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sUpozornění:%2$s %3$s Verze 10.6 mění výchozí nastavení několika krátkých kódů. Aby byla zachována konzistence, nejsou tato nová výchozí nastavení %4$saktivována%5$s při aktualizaci z dřívější verze. Pokud se chcete dozvědět více o těchto změnách, přečtěte si náš %6$sblogový příspěvek%7$s nebo pokud chcete přejít na nové výchozí nastavení, zapněte %8$s možnost na stránce %9$s nastavení%10$s.','Use new parameter defaults (v.10.6)'=>'Použít nové výchozí parametry (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sUpozornění:%2$s %3$s Verze 11.0 zjednodušuje způsob načítání URL adres kanálů ICS. Tato změna využívá standardní vestavěnou funkci WordPress, takže by měla být plně kompatibilní se všemi stávajícími instalacemi. Pokud po aktualizaci na verzi 11 nebo novější narazíte na nové problémy, navštivte %4$sfóra podpory WordPress%5$s, kde vám pomohou.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sUpozornění:%2$s %3$s Verze 11.5.14.2 zavádí novou, bezpečnější metodu pro zpracování parametrů kalendáře při načítání přes AJAX. Vymažte všechny pluginy pro ukládání do mezipaměti, které používáte, abyste zajistili správné načítání kalendářů pomocí nové metody.','%1$sWelcome to %2$s version 12!%3$s Version 12.0 introduces additional troubleshooting tools, plus a number of performance improvements and interface refinements throughout. Please see the %4$schangelog%5$s for more details on this update.'=>'%1$sVítejte ve verzi %2$s 12!%3$s Verze 12.0 přináší další nástroje pro řešení problémů, řadu vylepšení výkonu a zdokonalení rozhraní. Podrobnější informace o této aktualizaci naleznete v %4$sseznamu změn%5$s.','Getting Started'=>'Začínáme','Settings'=>'Nastavení','Appearance'=>'Vzhled','Utilities'=>'Utility','System Report'=>'Systémová zpráva','Support'=>'Podpora','Upgrade to %1$s!'=>'Upgradujte na %1$s!','Show/hide all'=>'Zobrazit/skrýt vše','ICS file could not be retrieved or was empty. Please verify URL is correct, and check y