t %1$s','Close'=>'Zavřít','ICS Feed URL:'=>'URL kanálu ICS:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Ujistěte se, že používáte URL adresu %1$ssubscribe%2$s, nikoli URL adresu %3$sweb view%4$s.%5$s (Při zadání URL adresy přímo do webového prohlížeče by se měl stáhnout soubor %6$s.)','Calendar Title:'=>'Název kalendáře:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Nechte pole prázdné, pokud chcete použít výchozí název kalendáře. Zadejte %1$s, pokud chcete název zcela vynechat.','Calendar Description:'=>'Popis kalendáře:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Nechte pole prázdné, pokud chcete použít výchozí popis kalendáře. Zadejte %1$s, pokud chcete popis zcela vynechat.','View:'=>'Zobrazit:','month'=>'měsíc','list'=>'seznam','week'=>'týden','Count:'=>'Počet:','Format:'=>'Formát:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Nechte %1$s prázdné, chcete-li zahrnout všechny nadcházející události. %2$s musí být standardní %3$sřetězec formátu data PHP%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Zobrazit popisy událostí %1$s (změňte číslo v vloženém krátkém kódu, abyste nastavili limit slov) %2$s','Show event locations %1$s(if available)%2$s'=>'Zobrazit místa konání akcí %1$s(pokud jsou k dispozici)%2$s','Show event organizers %1$s(if available)%2$s'=>'Zobrazit organizátory akce %1$s(pokud jsou k dispozici)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sPoznámka:%2$s Další %3$smožnosti zobrazení%4$s jsou k dispozici po ruční úpravě zkráceného kódu po vložení.','Insert %1$s'=>'Vložit %1$s','Do even more with %1$s version 6!'=>'S verzí 6 %1$s můžete dělat ještě více!','Calendar Builder + Block Editor'=>'Tvůrce kalendáře + editor bloků','Configure all calendar settings with an easy visual interface, and use the new %1$s block to select your saved calendars from a dropdown in the Block Editor, no shortcode needed! %2$sLearn more...%3$s'=>'Nastavte všechny parametry kalendáře pomocí jednoduchého vizuálního rozhraní a pomocí nového bloku %1$s vyberte uložené kalendáře z rozevíracího seznamu v editoru bloků, bez nutnosti zadávat zkrácený kód! %2$sDalší informace...%3$s','Additional Views and Enhanced Features'=>'Další pohledy a vylepšené funkce','%1$s offers many new ways to display your calendar, including integrations with the popular %2$s and %3$s open source libraries. Month and year views with a sidebar for the selected day. "Up Next" works great for radio or TV station schedules. Widget and year availability are perfect for holiday bookings. Plus, additional capabilities are added to the core Month, Basic, List and Week views. %4$sView sample calendars...%5$s'=>'%1$s nabízí mnoho nových způsobů zobrazení kalendáře, včetně integrace s oblíbenými open source knihovnami %2$s a %3$s. Zobrazení měsíce a roku s postranním panelem pro vybraný den. Funkce „Up Next“ se skvěle hodí pro rozvrhy rozhlasových nebo televizních stanic. Widget a dostupnost po celý rok jsou ideální pro rezervace dovolených. Navíc jsou do základních zobrazení Měsíc, Základní, Seznam a Týden přidány další funkce. %4$sZobrazit ukázkové kalendáře...%5$s','Customization'=>'Přizpůsobení','Easy-to-use tools to completely customize your calendar colors, typography and more. Select one of our preset color palettes or create your own, with options to individually customize the color of each element in the calendar layout. Choose between your theme fonts, system fonts, or more than 20 included open source fonts. %1$sLearn more...%2$s'=>'Snadno použitelné nástroje pro úplné přizpůsobení barev kalendáře, typografie a dalších prvků. Vyberte si jednu z našich přednastavených palet barev nebo si vytvořte vlastní s možností individuálního přizpůsobení barvy každého prvku v rozložení kalendáře. Vyberte si mezi fonty motivu, systémovými fonty nebo více než 20 zahrnutými fonty open source. %1$sDalší informace...%2$s','ICS Events'=>'Události ICS','Turns %1$s into a full calendar management system. Create and edit new events directly in WordPress, and even integrate them seamlessly with your existing external ICS feeds. %2$sLearn more...%3$s'=>'Promění %1$s v kompletní systém pro správu kalendáře. Vytvářejte a upravujte nové události přímo ve WordPressu a dokonce je hladce integrujte do svých stávajících externích ICS feedů. %2$sDalší informace...%3$s','Localized Admin Interface'=>'Lokalizované rozhraní správce','All %1$s admin pages are translated into dozens of languages, including English, Czech, Danish, German, Greek, Spanish, Estonian, Finnish, French, Hungarian, Italian, Japanese, Korean, Lithuanian, Latvian, Norwegian, Dutch, Polish, Portuguese, Romanian, Russian, Slovak, Serbian, Swedish, Turkish, Ukrainian, and Chinese.'=>'Všechny %1$s stránky pro správu jsou přeloženy do desítek jazyků, včetně angličtiny, češtiny, dánštiny, němčiny, řečtiny, španělštiny, estonštiny, finštiny, francouzštiny, maďarštiny, italštiny, japonštiny, korejštiny, litevštiny, lotyštiny, norštiny, holandštiny, polštiny, portugalštiny, rumunštiny, ruštiny, slovenštiny, srbštiny, švédštiny, turečtiny, ukrajinštiny a čínštiny.','Visit %1$s to learn more.'=>'Více informací najdete na %1$s.','Calendar Builder screenshot'=>'Snímek obrazovky nástroje Calendar Builder','Appearance screenshot'=>'Screenshot vzhledu','Available now!'=>'Nyní k dispozici!','Get %1$s!'=>'Získejte %1$s!','Extensive color palette and typography options are available with %1$s. %2$sLearn More%3$s'=>'K dispozici je rozsáhlá paleta barev a typografických možností s %1$s. %2$sDalší informace%3$s','Color Palette'=>'Paleta barev','Match calendar color palette to current Block Theme colors'=>'Přizpůsobte paletu barev kalendáře aktuálním barvám motivu bloku','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Nahrazuje výchozí neutrální paletu barev %1$s nejbližšími odpovídajícími barvami z aktuální palety barev Site Editor Styles nebo souboru %2$s ve vašem motivu. Výběr barev je algoritmický a některé kombinace nemusí projít testy kontrastu přístupnosti. Toto nastavení nemá žádný vliv, pokud používáte „klasický“ motiv, který neobsahuje soubor %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar appearance or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sJedná se v současné době o beta verzi.%2$s Pro optimální zobrazení může být nutné provést některé úpravy vzhledu kalendáře nebo CSS, zejména pokud máte své kanály označené barevnými kódy. Funkčnost se může změnit.','Dark mode'=>'Tmavý režim','Inverts color palette (light colors on a dark background).'=>'Obrátí paletu barev (světlé barvy na tmavém pozadí).','Save Changes'=>'Uložit změny','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Děkujeme za instalaci %1$s. Než vytvoříte svůj první zkrácený kód kalendáře, navštivte stránku %2$sObecná nastavení%3$s a zkontrolujte, zda jsou nastavení jazyka, časového pásma a formátu data/času na vašem webu správná. Další informace naleznete v naší %4$suživatelské příručce%5$s.','Get started with %1$s in four easy steps... and you\'ve already completed step one! Check out our %2$sQuick Start Guide%3$s for the rest.'=>'Začněte s %1$s ve čtyřech snadných krocích... a první krok už máte za sebou! Podívejte se na naši %2$sRychlou příručku%3$s pro další informace.','Quick Start Guide'=>'Stručný návod k obsluze','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Na našich webových stránkách je k dispozici rozsáhlá %1$suživatelská příručka%2$s. Níže naleznete několik rychlých odkazů na klíčové zdroje v dokumentaci.','General:'=>'Obecné:','General WordPress Settings'=>'Obecná nastavení WordPressu','%1$s Settings'=>'%1$s Nastavení','Working with Shortcodes:'=>'Práce s krátkými kódy:','Shortcode Overview'=>'Přehled zkrácených kódů','Shortcode Builder'=>'Stavitel Shortcodů','Shortcode Parameters Reference'=>'Referenční tabulka parametrů zkrácených kódů','Advanced Topics:'=>'Pokročilá témata:','FAQs and Tips'=>'Často kladené otázky a tipy','CSS Guide'=>'Průvodce CSS','Developer Resources'=>'Zdroje pro vývojáře','GDPR'=>'GDPR','Loading'=>'Načítání','Always use AJAX to render calendars'=>'K vykreslování kalendářů vždy používejte AJAX.','AJAX loading is now automatic. You can override AJAX, if necessary, by adding %1$s to your shortcode.'=>'Načítání AJAX je nyní automatické. V případě potřeby můžete AJAX přepsat přidáním %1$s do svého zkráceného kódu.','Increase memory limit when rendering calendars'=>'Zvýšení limitu paměti při vykreslování kalendářů','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Pokud se váš kalendář nenačte a zobrazí se fatální chyba „nedostatek paměti“, zkuste zvýšit limit paměti. Doporučuje se minimálně 512 MB. %1$s Poznámky: 1) Někteří poskytovatelé hostingu nemusí aplikacím umožňovat přepsat výchozí nastavení serveru. 2) Není možné nastavit tuto možnost na hodnotu nižší než aktuální výchozí limit paměti na vašem serveru.','deprecated'=>'zastaralý','Some servers may not support the default feed request method. If your feeds are not loading, turn on this option to use the legacy request method. This feature is deprecated and will be removed in a future update.'=>'Některé servery nemusí podporovat výchozí metodu požadavku na feed. Pokud se vaše feedy nenačítají, zapněte tuto možnost a použijte starší metodu požadavku. Tato funkce je zastaralá a bude v budoucí aktualizaci odstraněna.','Default shortcode'=>'Výchozí zkrácený kód','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Pokud bude váš web obsahovat velké množství podobně nakonfigurovaných zkratek kalendáře, můžete zde zadat výchozí "základní" zkratku s parametry, které by měly být pro všechny kalendáře stejné. Jednotlivé zkrácené kódy na webu pak mohou obsahovat pouze parametry, které jsou pro daný kalendář jako takový jedinečné: %1$s Jakékoli parametry obsažené v jednotlivých zkrácených kódech budou mít přednost před parametry nastavenými zde.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Povolit přístup k těmto hostitelským jménům, která se převádějí na vyhrazené IP adresy','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Pokud je váš kalendářový server hostován na stejném fyzickém serveru jako vaše webové stránky, je součástí stejné místní sítě nebo jinak používá %1$svyhrazenou IP adresu%2$s, zadejte sem jeho název hostitele, abyste povolili přístup. V případě více kalendářových serverů zadejte jeden název hostitele na jeden řádek. Další informace naleznete v %3$sdokumentaci%4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Zadejte jeden název hostitele na řádek. Názvy hostitelů jsou základní doménové názvy, nikoli úplné adresy URL. %1$s Například byste zadali %2$s, nikoli %3$s.','Allow access to these ports'=>'Povolit přístup k těmto portům','WordPress automatically allows access to ports 80, 443, and 8080. If you need to be able to access source calendars that use non-standard ports, enter the port numbers here, separated by commas.'=>'WordPress automaticky povoluje přístup k portům 80, 443 a 8080. Pokud potřebujete přístup ke zdrojovým kalendářům, které používají nestandardní porty, zadejte sem čísla portů oddělená čárkami.','Caching'=>'Mezipaměť','Transient (cache) expiration'=>'Vypršení platnosti dočasné (cache)','seconds'=>'sekund','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour). Minimum allowed value is 120 (2 minutes).'=>'Nastavuje, jak dlouho mají být data kalendářového kanálu uložena v mezipaměti serveru (WordPress transients) před opětovným načtením. Výchozí hodnota je 3600 (1 hodina). Minimální povolená hodnota je 120 (2 minuty).','Admin'=>'Admin','Minimum access role'=>'Role minimálního přístupu','Identifies the minimum user role that is allowed to access %1$s admin pages. Certain areas such as Settings are further restricted to %2$s users only (%3$s users on Multisite configurations).'=>'Určuje minimální roli uživatele, která má povolen přístup k %1$s stránkám správce. Některé oblasti, jako například Nastavení, jsou dále omezeny pouze na %2$s uživatele (%3$s uživatele v konfiguracích Multisite).','Register Customizer'=>'Registrovat přizpůsobovač','WordPress no longer includes a link to the Customizer in the Appearance menu when a Block Theme is active. Check this box if you wish to use the Customizer, e.g. for the Additional CSS input. Note: Some themes or plugins may already register the Customizer, in which case, this setting will have no effect. (The checkbox only enables the Customizer when checked; it does not disable the Customizer when unchecked.'=>'WordPress již neobsahuje odkaz na nástroj Customizer v nabídce Vzhled, pokud je aktivní bloková šablona. Zaškrtněte toto políčko, pokud chcete použít nástroj Customizer, např. pro zadání dodatečného CSS. Poznámka: Některé šablony nebo pluginy již mohou mít nástroj Customizer zaregistrován, v takovém případě nebude mít toto nastavení žádný účinek. (Zaškrtnutím políčka se nástroj Customizer pouze aktivuje; jeho nezaškrtnutím se nástroj Customizer deaktivuje.','Remove "Add ICS Calendar" button in Classic Editor'=>'Odebrat tlačítko „Přidat kalendář ICS“ v klasickém editoru','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Ve výchozím nastavení přidává ICS Calendar tlačítko „Přidat ICS Calendar“ na panel nástrojů nad editorem WYSIWYG při použití klasického editoru. Zaškrtnutím tohoto políčka tlačítko odstraníte. Nemá žádný vliv na weby používající blokový editor (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s Verze 10.6 zavedla nové výchozí hodnoty pro několik parametrů zkrácených kódů. Nové instalace automaticky používají nové výchozí hodnoty, ale aktualizované instalace budou i nadále používat staré výchozí hodnoty, pokud není zaškrtnuto toto políčko. Více informací o těchto změnách najdete na %2$snašem blogu%3$s.','User Guide'=>'Uživatelská příručka','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Naše kompletní uživatelská příručka je k dispozici v plném překladu do desítek jazyků na našich webových stránkách:','For assistance, please use our %1$ssupport request form%2$s.'=>'Pro pomoc použijte prosím náš %1$sformulář žádosti o podporu%2$s.','When contacting support, please include the %1$ssystem report%2$s from this page.'=>'Při kontaktování podpory prosím přiložte %1$ssystémovou zprávu%2$s z této stránky.','Spread the word!'=>'Zmieňte se o nás!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Pokud vám %1$s přijde užitečné, můžete nám pomoci v dalším růstu a rozvoji tím, že nám dáte %2$spět hvězdičkové hodnocení%3$s. Děkujeme!','Calendar Status: %1$sPaused%2$s'=>'Stav kalendáře: %1$sPozastaveno%2$s','Calendar Status: %1$sActive%2$s'=>'Stav kalendáře: %1$sAktivní%2$s','Use the pause button if you need to temporarily turn off %1$s on your front end pages.'=>'Pokud potřebujete dočasně vypnout %1$s na svých úvodních stránkách, použijte tlačítko pauzy.','Resume Calendars'=>'Kalendáře životopisů','Pause Calendars'=>'Pozastavit kalendáře','No content will be altered, but your calendars will be hidden and no %1$s asset files (JavaScript, CSS) will be loaded on front-end pages. If you are using caching via a plugin or through your hosting provider, you may need to clear the cache after changing this setting.'=>'Obsah nebude změněn, ale vaše kalendáře budou skryty a na front-endových stránkách nebudou načteny žádné soubory %1$s (JavaScript, CSS). Pokud používáte ukládání do mezipaměti prostřednictvím pluginu nebo prostřednictvím svého poskytovatele hostingu, možná budete muset po změně tohoto nastavení vymazat mezipaměť.','%1$s Data Cache'=>'%1$s Datová mezipaměť','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Tím se okamžitě vymažou všechna existující data kalendáře uložená v mezipaměti (vyčištění přechodných dat) a WordPress bude nucen při příštím zobrazení znovu načíst všechny kalendáře. Ukládání do mezipaměti bude poté pokračovat jako dříve.','Clear Cached Calendar Data'=>'Vymazat data z mezipaměti kalendáře','If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Pokud používáte plugin pro ukládání do mezipaměti od jiného výrobce, může být po spuštění tohoto nástroje nutné vymazat mezipaměť celého webu.','Are you sure? This will reset all %1$s settings to their defaults. Your saved calendar configurations and shortcodes will be retained, but resetting the defaults may change the appearance of your calendars. If you are using a third-party caching plugin, you may need to clear your site-wide cache after running this utility.'=>'Jste si jistý? Tím se obnoví všechna nastavení %1$s na výchozí hodnoty. Uložené konfigurace kalendáře a zkratky zůstanou zachovány, ale obnovení výchozích nastavení může změnit vzhled vašich kalendářů. Pokud používáte zásuvný modul mezipaměti třetí strany, může být nutné po spuštění tohoto nástroje vymazat mezipaměť celého webu.','Only clear transients (default)'=>'Pouze jasné přechody (výchozí nastavení)','Also clear all saved ICS feed URLs'=>'Vymažte také všechny uložené adresy URL kanálů ICS.','Reset %1$sall%2$s %3$s settings (including transients and feed URLs)'=>'Obnovit %1$svšechna%2$s %3$s nastavení (včetně přechodných stavů a adres URL zdrojů)','Last cleared:'=>'Poslední vymazání:','never'=>'nikdy','ICS Feed URL Tester'=>'ICS Feed URL Tester','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Pokud máte obavy, že plugin správně načítá váš feed, můžete zde otestovat URL.','Enter feed URL...'=>'Zadejte adresu URL zdroje...','Test URL'=>'Testovací URL','Results:'=>'Nalezené výsledky %s','%1$s received.'=>'%1$s přijato.','This appears to be a valid ICS feed URL.'=>'Toto se jeví jako platná adresa URL kanálu ICS.','unknown'=>'neznámý','This does not appear to be a valid ICS feed URL.'=>'Toto se nezdá být platnou adresou URL zdroje ICS.','Could not retrieve data from the requested URL.'=>'Nelze načíst data z požadované adresy URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Při pokusu o načtení požadované adresy URL došlo k neznámé chybě.','Please copy the following text and include it in your message when emailing support.'=>'Zkopírujte následující text a vložte jej do své zprávy, když budete posílat e-mail na podporu.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Uveďte také zkrácený kód %1$s přesně tak, jak jste jej zadali na příslušné stránce.','No events found.'=>'Nebyly nalezeny žádné akce.','Previous Page'=>'Předchozí stránka','Next Page'=>'Další stránka','All Day'=>'Celý den','Previous Month'=>'Předchozí měsíc','Next Month'=>'Následující měsíc','Today'=>'Dnes','Month selection'=>'Výběr měsíce','No events.'=>'Žádné události.','No additional events this month.'=>'Tento měsíc se nekonají žádné další akce.','Week selection'=>'Výběr týdne','Last week'=>'Minulý týden','This week'=>'Tento týden','Next week'=>'Příští týden','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Proměňte svůj kalendář Google, Microsoft Office 365 nebo Apple iCloud v dokonale integrovaný, automaticky aktualizovaný a bezúdržbový WordPress.','Room 34 Creative Services, LLC'=>'Pokoj 34 Kreativní služby, LLC']];
